enum ExportInfo<'a> {
    Regular {
            address: u64,
            flags: Flag,
        },
    Reexport {
            lib: &'a str,
            lib_symbol_name: Option<&'a str>,
            flags: Flag,
        },
    Stub {
            stub_offset: scroll::Uleb128,
            resolver_offset: scroll::Uleb128,
            flags: Flag,
        },
}

enum Reexport<'a> {
    DLLName {
            export: &'a str,
            lib: &'a str,
        },
    DLLOrdinal {
            ordinal: usize,
            lib: &'a str,
        },
}

